import React from 'react';
import {StyleSheet, View, Text} from 'react-native';

import DigitView from './DigitView';

const getWeek = (firstDay,weekNum) => {
  let week=[];
  for(let i = 1; i < 8; i++){
    week.push(
      <Text key={i} style={styles.daysOfWeek}>
        {'\n'}{i}{'\n'}
      </Text>
    )
  }
  return week;
}

const getMonth = () => {
  let month = [];
  let count=1;
  for(let i = 1; i < 6; i++){
    count=count+1;
    month.push(
      <View style={styles.daysOfTheWeek}>
      <Text>{getWeek(count)}</Text>
    </View>
    )
    return month;
}
}

const App = () => {
  return (
    <View>
      <View style={styles.monthName}>
        June
      </View>
      <View style={styles.daysOfWeek}>
        <Text style={styles.daysOfWeek}>Sunday</Text>
        <Text style={styles.daysOfWeek}>Monday</Text>
        <Text style={styles.daysOfWeek}>Tuesday</Text>
        <Text style={styles.daysOfWeek}>Wednesday</Text>
        <Text style={styles.daysOfWeek}>Thursday</Text>
        <Text style={styles.daysOfWeek}>Friday</Text>
        <Text style={styles.daysOfWeek}>Saturday</Text>
      </View>
      <Text style={styles.daysOfWeek}>{getMonth()}</Text>
      <Text></Text>
    </View>
  );
};

const styles = StyleSheet.create({
  monthName: {
    flex: 1,
    padding: 40,
    margin:20,
    borderWidth:2,
    borderColor:"#fff",
    backgroundColor:"#F2FADA",
    fontWeight:'bold',
    justifyContent:'center',
    textAlign:'center',
    fontSize:40,
  },
  daysOfWeek: {
    flex: 5,
    borderWidth:1,
    borderColor:"black",
    fontSize:30,
    justifyContent:'center',
    textAlign:"center",
    flexDirection:'row',
  }
});

export default App;
